[{"location":"","page":"Home","title":"Home","text":"CurrentModule = RandomFeatureMaps","category":"page"},{"location":"#RandomFeatureMaps","page":"Home","title":"RandomFeatureMaps","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for RandomFeatureMaps.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [RandomFeatureMaps]","category":"page"},{"location":"#RandomFeatureMaps.RandomFourierFeatures","page":"Home","title":"RandomFeatureMaps.RandomFourierFeatures","text":"RandomFourierFeatures(n => m, σ)\n\nMaps n-dimensional data and projects it to m-dimensional random fourier features.\n\nExamples\n\njulia> rff = RandomFourierFeatures(2 => 4, 1.0); # maps 2D data to 4D\n\njulia> rff(rand(2, 3)) |> size # 3 samples\n(4, 3)\n\njulia> rff(rand(2, 3, 5)) |> size # extra batch dim\n(4, 3, 5)\n\n\n\n\n\n","category":"type"},{"location":"#RandomFeatureMaps.RandomOrientationFeatures","page":"Home","title":"RandomFeatureMaps.RandomOrientationFeatures","text":"RandomOrientationFeatures\n\nCan be called on rigid transformations to create pairwise maps of random orientation features. This type has no trainable parameters.\n\nExamples\n\njulia> rof = RandomOrientationFeatures(4, 0.1);\n\njulia> rigid = (randn(3, 3, 2), randn(3, 1, 2)); # cba to make it orthonormal and whatevs\n\njulia> rof(rigid) |> size\n(4, 2, 2)\n\n\n\n\n\n","category":"type"},{"location":"#RandomFeatureMaps.RandomOrientationFeatures-Tuple{Integer, AbstractFloat}","page":"Home","title":"RandomFeatureMaps.RandomOrientationFeatures","text":"RandomOrientationFeatures(m, σ)\n\nCreates a RandomOrientationFeatures instance, mapping to m features.\n\n\n\n\n\n","category":"method"}]
